import CompanyBio from './CompanyBio'
import Home from './Home'
import { Routes, Route } from 'react-router-dom'


function App() {
  return (
    <Routes>
      <Route path="/" element={Home} />
      <Route exact path="/bio" element={CompanyBio} />
    </Routes>



  );
}

export default App;
